// src/redux/reducers/authReducer.js
import { REGISTER_USER, REGISTER_ERROR } from '../type';

const initialState = {
  user: null,
  error: null,
};

const authReducer = (state = initialState, action) => {
  switch (action.type) {
    case REGISTER_USER:
      return {
        ...state,
        user: action.payload,
        error: null,
      };
    case REGISTER_ERROR:
      return {
        ...state,
        error: action.payload,
      };
    default:
      return state;
  }
};

export default authReducer;
